import React from "react";

const DateStream = ({ memories }) => {
  return (
    <div className="flex flex-col gap-12 pt-8 pr-6 items-end text-right w-24">
      {memories.map((memory, i) => (
        <div key={i} className="text-xs text-gray-500 font-semibold whitespace-nowrap">
          {memory.date}
        </div>
      ))}
    </div>
  );
};

export default DateStream;
